import './ForTest.css'
import { motion } from "framer-motion"
 
function ForTest(){
    return(
        <motion.div 
        className = "block"
        animate={{ x: 100 }}
        transition={{ease: "easeIn", duration: 2}}
        
        >

        </motion.div>
    )
}

export default ForTest
